import axios from 'axios'
import React, {useEffect, useState} from 'react'


function ProductosDisponibles(){

    const[dataproductos, setdataproductos]=useState([])

    
    useEffect(() => {

        axios.get('api/producto/obtenerproducto').then(res => {
            console.log(res.data)
            setdataproductos(res.data)
        }).catch(err => {
            console.log(err)
        })
       
    },[])

    //Mapera listaproductos en objeto productos
    const listaproductos = () => {
        return dataproductos.filter(setdataproductos => setdataproductos.cantidad == 2)
    }
    

    return(
        <div>
            <h2>Lista de Prodcutos</h2>
            {listaproductos}
           
        </div>
    )
}
export default ProductosDisponibles
